    def test_rss_parse(self):
        """
        Make sure that the parsed_feed util. parses the rss feed and returns valid keys.
        """
        parsed = parse_feed(self.test_rss)
        self.assertEqual(len(parsed), 7)
        self.assertEqual(parsed.keys(), ['feed', 'encoding', 'bozo', 'version',
                                         'namespaces', 'entries', 'bozo_exception'])

    def test_media_credit_is_returned(self):
        """
        A slightly modified version of feedparser is being used to capture media information.
        The media namespace in the latest release of feedparser is completely ignored and credit data
        is not returned.  Make sure the modified version of feedparser returns credit data
        """
        parsed = parse_feed(self.test_rss)
        entry = parsed.get('entries', None)[0]
        credit_info = entry.get('media_credit', None)[0]
        self.assertEqual(credit_info, {'content': u'MTV Choose or Lose',
                                       'scheme': u'urn:feeds-wiredrive-com:credits',
                                       'role': u'client'})
